                        Blogs
                    </Button>
                </Box>
 
                <Box sx={{marginTop:"25px"}}>
 
                    {/* Search Icon */}
 
                    {searchOpen && (
                        <InputBase placeholder="Search..." autoFocus style={{ width:"100px", height:"auto", backgroundColor:"#d3eef7", borderRadius:"40px" }} />
                    )}
                    <IconButton onClick={() => setSearchOpen(!searchOpen)}
                    >
                        <Search sx={{
                            backgroundColor: "linear-gradient(45deg, #3593B0 0%, #4A9B85 100%)",
                            borderRadius: "100%"
                        }} />
                    </IconButton>
 
                    {/* App Store Icon */}
                    <Button onClick={() => setAppStoreOpen(!appStoreOpen)}>
                        <img src="/Images/app_icon.jpg" alt="app icon" style={{ width: "25px", height: "auto" }} />
                    </Button>
                    {appStoreOpen && (
                        <Box position="absolute" top={50} right={100} bgcolor="white" p={2} boxShadow={3} gap={4} sx={{width:"400px", display:"block", borderRadius:"10px"}}>
                            <Typography>Mobile Number</Typography>
                            <InputBase placeholder="Enter mobile number" fullWidth />
                            <Typography variant="caption">*By clicking on proceed you agree to MMM consent</Typography>
                            <br></br>
                            <Button variant="contained" color="primary">Get Link</Button>
                        </Box>
                    )}
 
                    {/* Sign In Button */}
                    <Button variant="outlined" sx={{
                        backgroundImage: "linear-gradient(45deg, #3593B0 0%, #4A9B85 100%)",
                        color: "white",
                        border: "none",
                        fontFamily: "Manrope, sans-serif !important",
                        //  width:"120px",
                        padding: "8px 25px",
                        borderRadius: "8px",
                        textTransform: "none",
                        fontWeight: "bold",
                        fontSize: "18px",
                        // "&:hover": {
                        //   backgroundImage: "linear-gradient(45deg, #4A9B85 0%, #3593B0 100%)", // Inverted colors on hover
                        // },
                    }}>
                        Sign In
                    </Button>
                </Box>
 
            </Toolbar>
        </AppBar>
    );
};
 
export default Navbar;
